INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (70, 2, 'TCH Expected value differs because CT used 2 month interval rather than 8 week interval.  TCH overdue date differs also because we carry through to 16th month rather than it becoming overdue at 15 months.', '2010-06-08 14:45:12');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (73, 2, 'Hep B TCH Actual due is correct; default to minimum interval b/c child is behind on 3rd HepB. HepB TCH Expected overdue different from TCH Actual overdue b/c we carry through the 18th month.', '2010-06-08 15:12:38');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (41, 2, 'TCH Expected Due date is correct and TCH Actual is incorrect b/c actual is forecasting 4 years from date of administration of 1st dose rather than 4 years from DOB.  TCH Expected Overdue date is incorrect; 2nd dose becomes overdue at 7 yrs of age therefore TCH Actual overdue date is correct.', '2010-06-08 15:20:47');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (2, 2, 'TCH Actual dose should be 2.', '2010-06-08 15:56:25');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (3, 2, 'TCH Actual dose should be 3.  TCH Actual valid date is incorrect.  2nd dose is valid therefore 3rd dose valid at 24 weeks of age.  TCH Actual due date is incorrect. B/c child is behind, due date defaults to minimum interval therefore TCH Actual should forecast due at 07-19-2006.  TCH Actual overdue date incorrect.  Child becomes overdue for 3rd dose at 19 months of age.', '2010-06-08 16:07:05');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (103, 2, 'TCH actual and expected dates are correct.  TCH actual due date is different because the child is behind so forecaster is utilizing the catch up schedule, so 4 week interval between dose 1 and dose 2 makes due date at 07-09-2006.  TCH actual overdue date is accurate as dose 2 is due at 4 months so forecaster puts overdue at the age of 5 months. ', '2010-06-09 10:08:36');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (104, 2, 'Tch Expected and TCH Actual valid dates are correct.  Tch Actual Due date is correct as the child is now behind and therefore the forecaster has chosen the catch up date based on 8 week interval between dose 2 and dose 3 if the the current age is 12 months or older.  The TCH Actual overdue is correct  because the third dose is recommended at age 6 months so therefore is overdue at the 7 month.  ', '2010-06-09 10:21:46');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (103, 2, 'For above - TCH actual and expected valid dates are correct.', '2010-06-09 10:24:09');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (106, 2, 'I think the birthdate may have been entered incorrectly on this patient.  DOB is listed as 2006-12-01 and shots were received prior to birthdate.', '2010-06-09 10:26:20');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (109, 2, 'TCH Actual dose is correct as B for booster dose, so TCH expected should be also B. TCH valid and expected is correct as Valid date is 8 weeks after 3rd dose which is minimum interval between doses 3 and 4.  TCH Expected and Actual are correct as child is behind so forecaster has used catch up schedule therefore the booster dose is due 8 weeks after the third dose.  The TCH Actual and Expected dates are correct as dose 4 is recommended at 12-15 months so it would be overdue at the 16 month.', '2010-06-09 10:36:42');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (117, 2, 'TCH Expected and Actual are correct that dose 3 can not be given before 12 months old, should be listed B', '2010-06-09 10:55:35');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (119, 2, 'TCH Actual is incorrect as child should be in the catch up schedule.  There is a minimum interval of 8 weeks between dose 2 and dose 3.  TCH Overdue date should be through the 15 month and so should refelct the overdue at month 16.  I changed the TCH Expected overdue date to reflect the 16 month.', '2010-06-09 11:12:37');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (121, 2, 'TCH Actual fails as the TCH overdue date should be 8 weeks between dose 2 and dose 3 and not 2 months between. TCH overdue date was changed to reflect through to the 16 month.', '2010-06-09 11:53:41');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (121, 2, 'TCH Actual fails as the TCH overdue date should be 8 weeks between dose 2 and dose 3 and not 2 months between. TCH overdue date was changed to reflect through the 15 month.', '2010-06-09 11:54:11');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (106, 2, 'Nathan Bunker: I confirm this, the birth date was typed in wrong, it was off by one year. I am fixing this now. ', '2010-06-10 08:49:05');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (106, 2, 'Nathan Bunker: I confirm this, the birth date was typed in wrong, it was off by one year. I am fixing this now. ', '2010-06-10 09:10:30');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (106, 2, 'Nathan Bunker: Because the birth date was after the vaccination dates the vaccinations were not imported into Web1, so the forecast returned no response. Once I set the dob right, and imported the data I was able to get a response from the forecaster that matched the expected.', '2010-06-10 09:12:50');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (3, 2, 'I did some research on this and the reason why it is failing is because the vaccine given at birth is not considered valid to be given at birth. The forecaster considers CVX ''45'' to be valid at birth and not ''08''. Should I change the CVX code? ', '2010-06-10 09:33:50');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (2, 2, 'Nathan Bunker: I fixed problem of actual dose being wrong by changing schedule so that CVX 08 is considered valid for the first dose. Previously only Hep B, NOS (45) was considered valid. ', '2010-06-10 11:22:32');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (106, 2, 'TCH Acutal is correct with dose as B for booster.  Valid Due and Overdue dates are correct as we consider overdue at the 16 month.', '2010-06-11 10:23:39');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (121, 2, 'This failed because TCH Due was incorrect because there should be 8 weeks between dose 2 and dose 3 and not 2 months.  TCH overdue date was changed to reflect through the 15 month.', '2010-06-11 10:28:05');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (122, 2, 'Failed because Due date should reflect 8 week interval instead of 2 month interval.  TCH Overdue is correct in that it refelcts through the 15 month.  Changed TCH Expected dose to B for booster and Overdue date to reflect through the 15 month.', '2010-06-11 10:32:54');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (125, 2, 'Passed.  TCH Actual and Expected Overdue are correct as we interpret Overdue through the 2nd month.', '2010-06-11 10:37:42');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (126, 2, 'TCH Expected and Actual dose, Valid, and Due dates are correct.  Overdue is incorrect as Overdue shoudl relfect through the 4 month which would be 08/04/2006.  Failed and TCH Expected changed to reflect correct Overdue date.', '2010-06-11 10:56:55');
INSERT INTO test_note (test_case_id, user_id, note_text, note_date) VALUES (128, 2, 'Failed.  TCH Expected and Actual dose number is correct, Valid and Due dates are correct.  Overdue dates are wrong and should refelct Overdue through the 4 month to 07/26/2006', '2010-06-11 11:01:45');
